function _(a){return document.getElementById(a)}function pi(a){return parseInt(a)}function phoneNumber(a,b){var d=(b.which)?b.which:b.keyCode;if((d>31&&(d<48||d>57))&&!(d>95&&d<106)){b.preventDefault();return false}}function resetForm(b,a){b.type="password";a.classList.remove("hide-password");a.classList.add("show-password")}function togglePassword(a){var b=_("signup_password");if(b.type=="password"){b.type="text";a.classList.remove("show-password");a.classList.add("hide-password")}else{resetForm(b,a)}}function startTimer(){var b=_("timerday");var a=_("timerhour");var d=_("timerminute");var c=_("timersecond");setInterval(function(){var j={day:pi(b.innerHTML),hour:pi(a.innerHTML),minute:pi(d.innerHTML),second:pi(c.innerHTML)};var g=j.second;if(g>0){c.innerHTML=g-1}else{c.innerHTML=59;var e=j.minute;if(e>0){d.innerHTML=e-1}else{d.innerHTML=59;var f=j.hour;if(f>0){a.innerHTML=f-1}else{a.innerHTML=24;var i=j.day;if(i>0){b.innerHTML=i-1}else{window.location.reload()}}}}},1000)}function checkAns(c,d){if(d.value==""){c.classList.remove("gbutton");c.classList.add("rbutton")}else{c.classList.remove("rbutton");c.classList.add("gbutton")}}function resetButton(a){a.classList.remove("rbutton");a.classList.remove("gbutton")}function toggleMenu(){var a=_("navcontainer");var b=a.classList;if(a.getAttribute("status")=="collapse"){b.remove("collapse");b.add("expand");a.setAttribute("status","expand")}else{b.remove("expand");b.add("collapse");a.setAttribute("status","collapse")}};